import * as React from 'react';
import JobSearch from '../job_search';
import '../output.css';
import Logo from './seek_logo.png';

export default function Tabs() {
    const [pageIndex, setpageIndex] = React.useState(0)





    return (
        <div>
            <div class="flex space-x-10 w-1/2 bg-seekblue">
                <div class="">
                    <img class="" width='100px' src={Logo} alt="seek logo"/>
                </div>
                
                <div class=" flex space-x-10 bg-pink">
                    
                    <span class ="translate-y-1/4">Job Search</span>
                    <div class="">Profile</div>
                    <div>Career advice</div>
                    <div>Explore companies</div>
                </div>

            </div>
            
        
        </div>

    );
}
